    [],nt"num_tags": 4,nt"name": "audubon-wetland-management-district-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Audubon
    Wetland Management District outlines Refuge accomplishments during the 1987 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. Planning is discussed; topics include compliance with
    environmental and cultural resource mandates and research and investigations. Habitat
    management is also covered; subjects include wetlands, croplands, grasslands, grazing,
    haying, fire management, pest control, and WPA easements. The wildlife section of
    the report discusses endangered and threatened species, migratory birds, and game
    mammals. The public uses of the Refuge described in this report include hunting
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction. Cooperative programs are provided at the end.
    Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
